import React, { FC } from "react";

interface TodoFormComponentProp {
    changeHandler: (e: React.ChangeEvent<HTMLInputElement>) => void
    clickHandler: (e: React.MouseEvent<HTMLButtonElement>) => void
}

const TodoFormComponent: FC<TodoFormComponentProp> = ({changeHandler, clickHandler}) => {
    return (
        <div className='task-add'>
            <input type="text" placeholder='Title' onChange={changeHandler}/>
            <button type='submit' onClick={clickHandler}>Add</button>
        </div>
    )
}

export default TodoFormComponent
